function runConsultationsDateToLocal(){try{consultationsDateToLocal()}catch(n){console.error(n)}}function consultationsDateToLocal(){Array.from(document.getElementsByClassName("startTime")).forEach(n=>{n.textContent=new moment(moment.utc(n.textContent).toDate()).format("HH:mm - L")})}window.addEventListener("DOMContentLoaded",consultationsDateToLocal);